{"title": "CURL UP Hair Wash Combo with Curly Hair Shampoo & Conditioner-(2 items ) 400 ml", "category": "Grooming", "vertical": "Shampoo", "highlights": ["Frizz Control Shampoo", "Ideal For: Men & Women", "Suitable For: Frizzy Hair", "Composition: Argan oil and Chia Seed extracts, Argan oil, Chia Seed extract and Flax Seed extract"], "subCategory": "HairCare", "superCategory": "Grooming", "variantAttributes": {"quantity": "400 ml"}, "detailedDescription": "Looking for a quick fix for dry, frizzy curls that seem to lack lustre and life? Weve got your back with the basics. Our all-new combination pack of our Shampoo and Conditioner gives you excellent washday results sans the fuss!

Start off with our Curl Moisturising Shampoo, which is a mild coconut-based cleanser that gently cleans the scalp and hair without stripping away the natural oils transforming dry and frizzy hair into soft, bouncy, happy curls. Natural ingredients like Argan oil and Chia Seed extracts with high content of antioxidants and vitamin E, brings your luxurious waves and curls back to life.

Follow this up with our Curl Hydrating Conditioner that is an ultra-rich and nourishing formula with Argan oil, Chia Seed extract and Flax Seed extract which provides good slip, thereby making it easy to detangle your curly locks. It locks in moisture and strengthens curly hair to prevent breakage and split ends.", "product_details_specifications": {"specifications": [{"name": "Pack of", "values": ["2"]}, {"name": "Brand", "values": ["CURL UP"]}, {"name": "Model Name", "values": ["Hair Wash Combo with Curly Hair Shampoo & Conditioner-(2 items )"]}, {"name": "Applied For", "values": ["Frizz Control"]}, {"name": "Hair Type", "values": ["Frizzy Hair"]}, {"name": "Composition", "values": ["Argan oil and Chia Seed extracts, Argan oil, Chia Seed extract and Flax Seed extract"]}, {"name": "Container Type", "values": ["Dispenser"]}, {"name": "Ideal For", "values": ["Men & Women"]}, {"name": "Maximum Shelf Life", "values": ["24 Months"]}, {"name": "Manufacturing Process", "values": ["Sulphate/Paraben Free"]}, {"name": "Net Quantity", "values": ["400 ml"]}, {"name": "", "values": ["gently cleans the scalp and hair without stripping away the natural oils transforming dry and frizzy hair into soft curls, It locks in moisture and strengthens curly hair to prevent breakage and split ends"]}]}}
